INSERT INTO `Paragraphs` (`paragraph_id`, `paragraph_name`, `paragraph_content`, `page_id`) VALUES
(1, 'OVK i Stockholm kommun', '				<h4 class="h4">Ansvarig avdelning hos kommunen</h4>\r\n\r\n					I Stockholms kommun är det <a href="http://www.stockholm.se/-/Kontakt/Kontakta-oss/?term=216509" target="_blank">Stadsbyggnadskontoret som ansvarar för OVK</a> bland andra uppgifter som boenderelaterade ämnen som bostäder, arbetsplatser, miljö och trafik. \r\n					Hos Stockholms Stadsbyggnadskontor kan du skicka in det färdiga ventilationsprotokollet för OVK och skriva under det med e-legitimation.\r\n					<br><br>	\r\n				<h4 class="h4">Register över fastigheter och OVK-protokoll</h4>\r\n					\r\n					För att registrera ett OVK-protokoll vänder du dig till Stockholms Stadsbyggskontors hemsida www.stockholm.se/sbk och laddar ner <a href="http://www.stockholm.se/PageFiles/77384/Ventilations_Protokoll_info.pdf" target="_blank">pdf-filen "Ventilationsprotokollet"</A>.  \r\n					Där finner du information om hur du du skickar in ventilationsprotokollet (och skapar e-legitimation för att kunna göra detta om du inte tidigare har sådan). \r\n 					<br><br>	\r\n 					Bra fastighetsinformation finns på Stockholms stads hemsida under “Fastighetsinformation” samt “Lantmäteri och fastighetsfrågor”.	\r\n					<br><br>\r\n						\r\n				<h4 class="h4">Mer information om OVK i Stockholms stad</h4>\r\n					\r\n					Läs om hur <a href="http://www.stockholm.se/ByggBo/Bygglov/a-o-lanksidor/Obligatorisk-ventilationkontroll-OVK/" target="_blank">OVK beskrivs och presenteras för boende och verksamma inom Stockholms stad</a>\r\n					\r\n 					På Stockholms stads hemsida finns kort text om OVK, exempelvis de olika stegen som skall kontrolleras beroende på fastighethetstyp och typ av ventilation. \r\n\r\n				<h4 class="h4">Kortfakta</h4>\r\n					\r\n					I Stockholms kommun finns det ca 60 000 fastigheter,  3532 aktiva BRF:er och ytterligare registrerade BRF:er som antingen vill/väntar på att ombildas eller som är under uppförande. I hela Stockholms län finns 308 674 villor och sedan år 2015 finns 73 489 fritidshus.\r\n	', 1),
(2, 'Vad får du svar på i din offerförfrågan?', '<div class="textFragment">\r\n 				När du ber leverantörerna om en offert får du svar på viktiga frågor. \r\n 			    Exempelvis: \r\n                 \r\n                   <ul class="mainUl">\r\n                     <li>Vilka leverantörer finns i mitt Stockholm? </li>\r\n                     <li>När och hur snabbt kan jag få OVK utfört?</li>\r\n                     <li>Vad kostar OVK-besiktningen?</li>\r\n                     <li>Hur prissätts OVK av leverantörerna? </li>\r\n                     <li>Vad påverkar tid och kostnad för OVK? </li>\r\n                     <li>Vilka kringtjänster till OVK finns? </li>\r\n                     <li>Ska jag välja samma leverantör till OVK som att utföra installation av ventilation? </li>\r\n                     <li>Vad ska jag tänka på i samband med åtgärdande av fel och brister som påträffas i OVK?</li>\r\n                     <li>Vilka är de senaste nyheterna kring lagar, regler, myndigheter eller IT-tjänster?</li>\r\n                   </ul>\r\n 				\r\n				</div>\r\n			<div class="title2"><h2 class="h2">Vilka uppgifter behöver vi av dig?</h2></div>\r\n				<div class="textFragment">Normalt sett behöver OVK-kontrollanterna bara veta några uppgifter för att ta fram en offert till dig.\r\n				 <br><br>Förutom dina kontaktuppgifter anger du bara:\r\n                \r\n                  <ul class="mainUl">\r\n                    <li>Fastighetsägare </li>\r\n                    <li>Fastighetsbeteckning</li>\r\n                    <li>Fastighetens adress</li>\r\n                    <li>Hur många lägenheter som finns i fastigheten</li>\r\n                    <li>typ av existerande ventilation (S, F, FT, FX, FTX)</li>\r\n                  </ul>\r\n        			Tjänsten fungerar även för dig som är privatperson och om det gäller ditt bostadshus. \r\n        			<br><br>\r\n        	        När du har skickat in uppgifterna kommer ett eller flera företag att höra av sig till dig med en offert. Du jämför erbjudanden och väljer om du vill beställa OVK-besiktningen. Allt är gratis för dig. \r\n					<br><br>\r\n				</div>\r\n			', 1);
